The future will be shaped by engineers. We need more women in engineering. 

At Dyson we are pleased to see positive progress. We've increased the representation of women on our Executive Committee by 37.5% over the past year. In the most recent cohort of the Dyson Institute, 41% identify as female, compared to a national average of 15.1% on engineering university courses. And for the last three years, the global James Dyson Award winners have been pioneering young women. 

To celebrate this year’s International Women in Engineering Day, we asked some of our female engineers to share their experiences in the industry. 

